import { useEffect, useState} from "react"
import { Link, useHistory, useParams } from "react-router-dom"
import userservice from "../services/User.service";

function Register(){
    const [user, setUser]= useState([]);

    const [email, setEmail]= useState('');
    const [username, setUserName]= useState('');
    const [password, setPassword]= useState('');
    const [type, settype]= useState('');
    const history = useHistory();
    const {id} = useParams();

    const saveUser = (e) => {
        e.preventDefault();

        const user = {id, username, email, password,type};
        userservice.create(user)
            .then(response => {
                console.log("user added successfully", response.data);
                history.push("/login");
            })
            .catch(error => {
                console.log('something went wrong', error);
            })
    }

    useEffect(() => {
        if (id) {
            userservice.get(id)
                .then(user => {
                    setEmail(user.data.email);
                    setUserName(user.data.username);
                    setPassword(user.data.password);
                    settype(user.data.type)
                })
                .catch(error => {
                    console.log('Something went wrong', error);
                })
        }
    }, [])

    return(
        <section class="testimonial py-5" id="testimonial">
    <div class="container">
        <div class="row ">
            <div class="col-md-4 py-5 bg-warning text-black text-center ">
                <div class=" ">
                    <div class="card-body">

                        <h2 class="py-3">Registration</h2>

                    </div>
                </div>
            </div>
            <div class="col-md-8 py-5 border">
                <h4 class="pb-4">Please fill with your details</h4>
                <form>
                    <div class="form-row">
                        <div class="form-group col-md-8">
                        <input
                             type="text"
                             className="form-control"
                            placeholder="User name"
                            value={username}
                            onChange={(e) => setUserName(e.target.value)}
                         />

                        </div>

                        <br></br>

                        <div class="form-group col-md-8">
                        <input
                            type="email"
                            className="form-control"
                            placeholder="Enter email"
                            value={email}
                            onChange={(e) => setEmail(e.target.value)}
                        />
                        </div>
                      </div>

                      <br></br>

                    <div class="form-row">
                        <div class="form-group col-md-8">
                        <input
                            type="password"
                            className="form-control"
                            placeholder="Enter password"
                            value={password}
                            onChange={(e) => setPassword(e.target.value)}
                        />
                        </div>

                        <br></br>



                        <div class="form-group col-md-8">
                        <select className="form-control col-4"
                            type="submit"
                            id="type"
                            value={type}
                            onChange={(e) => settype(e.target.value)}
                            placeholder="select user type from dropdown">
                            <option selected>choose user type</option>
                            <option value="Admin">Admin</option>
                            <option value="User">User</option>

                        </select>
                        </div>
                        <br></br>





                    </div>
                    <div class="form-row">
                        <div class="form-group">
                            <div class="form-group">
                                <div class="form-check">
                                  <input class="form-check-input" type="checkbox" value="" id="invalidCheck2" required></input>
                                  <label class="form-check-label" for="invalidCheck2">
                                    <small>By clicking Submit, you agree to our Terms & Conditions, Visitor Agreement and Privacy Policy.</small>
                                  </label>
                                </div>
                              </div>

                          </div>
                    </div>
                    <br></br>
                    <div class="form-row">
                        <button onClick={(e) => saveUser(e)} type="button" class="btn btn-danger">Submit</button>
                    </div>
                </form>
            </div>
        </div>
    </div>
</section>
    )
}
export default Register
